B.Qv=new A.bh("Existen dos maneras de que los alumnos jueguen a la partida:\n- Modo online: El alumno juega usando su tel\xe9fono y se conectar\xe1 con otros en su misma situaci\xf3n para jugar juntos en l\xednea. Si va a haber alumnos que usen esta modalidad, debe haber m\xednimo de dos conectados.\n- Modo local: Varios alumnos juegan usando un s\xf3lo tel\xe9fono.\n\nPara comenzar correctamente una partida con los jugadores sigue los pasos:\n1. Los alumnos en la aplicaci\xf3n tienen que elegir si jugar en modo local o en modo online, y continuar hasta la pantalla donde deben escribir el nombre de la partida. En el mismo aula puede.\n2. Diles el nombre de la partida a los alumnos para que puedan rellenar el campo y unirse.\n3. Los alumnos se quedan una sala de espera, y deben permancer ah\xed hasta que se conecten todos los jugadores.\n4. Cuando ya est\xe9n todos listos por empezar, pulsa el bot\xf3n de Empezar la partida de esta pantalla.\n5. Los alumnos comenzar\xe1n la partida y t\xfa pasar\xe1s a una pantalla donde seguir el progreso de las partida. Aqu\xed podr\xe1s terminar todas las partidas aunque no est\xe9n acabadas al pulsar el bot\xf3n para salir de la pantalla.",null,B.cd,null,null,null,null,null,null)
