B.Q7=new A.bh("Todo el contenido de la partida admite cambios: se puede a\xf1adir preguntas, editar las que ya existen o borrarlas. Las preguntas pueden ser de cuatros tipos:\n1. Pregunta textual con m\xfaltiples respuestas de texto.\n2. Pregunta con imagen con respuestas de texto.\n3. Pregunta con im\xe1genes de respuesta.\n4. Texto con huecos para ser rellenados.\nLos cambios que hagas se guardan autom\xe1ticamente.\n\nPuedes guardar la partida con otro nombre si quieres hacer una copia de este contenido pulsando el bot\xf3n de arriba a la derecha.",null,B.cd,null,null,null,null,null,null)
